import React, { useEffect,useRef } from 'react'
import {init} from "ityped"
import "./Intro.scss"

export default function Intro()
{
    const textRef = useRef()
    useEffect(() => {
        init(textRef.current, {
            showCursor: false,
            backDelay: 1500,
            backSpeed:40,
            strings:["Software Engineer"]
        })
    }, [])

    return (
        <div className="intro" id="intro">
            <div className="left">
                <div className="imageContainer">
                    <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fcode-cache.com%2Fen%2F2021%2F09%2F17%2Fa-little-about-the-importance-of-the-game-code%2F&psig=AOvVaw0URwXPyOJx-5lTxH8ykMdJ&ust=1652473683451000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCMCs3r_m2vcCFQAAAAAdAAAAABAE' alt=''/>
                   // <img src="/assets/portfolio_adobespark.png" alt="" />
                </div>
            </div>
            <div className="right">
                <div className="wrapper">
                    <h2>Hi There , I'm</h2>
                    <h1>Souley Abdoul</h1>
                    <h3>Freelance <span ref={textRef}></span></h3>
                    <a href="#portfolio">
                    <img src="/assets/down.png" alt="" />
                </a>
                </div>

            </div>
        </div>
    )
}
